const Meme = () => {
  return (
    <div class="meme-container">
      <div className="meme">
        <img className="meme-img" alt="meme" src={Meme} />
        <h2 className="top-text">Computer wondering how i'm winning</h2>
        <h2 className="bottom-text">Me Who uses the Undo button</h2>
      </div>
    </div>
  );
};

export default Meme;
